export let DisplayPokemons = ({pokemons, keys, filter, sortMethod}) => {
    let DisplayAttributes = ({p}) => {
        return (
            <div>
                <h4 > {p.name}:</h4>
                <ul>
                    {keys.map((key, index) => {
                    return <li key={index}>{key}: {p[key]}</li>
                    })}
                </ul>
            </div>

        )
    }
    console.log(filter)

    if (pokemons === undefined) return
    return (
        <div >
            {pokemons.sort(sortMethod).map(p=> {
                return filter === "" || p["type_one"] === filter ?
                    <DisplayAttributes p={p} ></DisplayAttributes>:<></>
            })}
        </div>
    );
}
